package com.javapractise;

public class J38MethodsPractise {
	
	static int max(int x,int y) {
		if (x>y)
			return x;
		else
			return y;
	}

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a= 10;
		int b= 5;
		int c;
		c = max(a,b);
		System.out.println(c);
		

	}

}
